import Posts from "../src/components/Posts/Posts";

export default( post= [], action)=> {
    switch (action.type) {
        case 'FETCH|_ALL':
            return action.payload;
        case ' CREATE':
            return Posts;
    
            
         
        default:
            return Posts;
    }
}
